stationDescription:
ТМ-радио - это онлайн-радиостанция для всей семьи с постоянным музыкальным эфиром, а также
специальными форматами, среди которых
- «live» выступления гостей студии и музыкантов;
- прямые включения с самых крутых событий;
- авторские передачи, сказки, рубрики и интервью.
	Больше

Основные цели, которые преследует проект «Наша Звезда»:

Создание условий для развития талантов и способностей людей с ограниченными физическими возможностями;
Представление творчества талантливых людей с ограниченными физическими возможностями широкому кругу читателей и слушателей;
Изменения сознания людей, которые закрылись в себе и не видят смысла в жизни.

«Радио ШТАНЫ» — первая коммерческая интернет-радиостанция в истории города Пенза.

— молодежная радиостанция;
— новый формат вещания, который включает в себя треки всех времен;
— музыка, которая делает настроение лучше;
— самые актуальные и информативные программы;
— уникальный в истории отечественного интернет-радио проект.
